import React, { Component } from "react"
import Passo from "./Passo"
import Display from "./Display"
import Buttons from "./Buttons"

export default class MyContador extends Component {

    render() {
        return (
            <div>
                <h2>Contador</h2>
                <Passo></Passo>
                <Display></Display>
                <Buttons></Buttons>
            </div>
        )
    }
}
